import React, { useState, useEffect } from 'react';

function CompanyList() {
  const [companies, setCompanies] = useState([]);
  const [selectedCompany, setSelectedCompany] = useState(null);

  // Get companies from sessionStorage
  useEffect(() => {
    const storedCompanies = JSON.parse(sessionStorage.getItem('companies')) || [];
    setCompanies(storedCompanies);
  }, []);

  // Sidebar functionality
  const openSidebar = (company) => {
    setSelectedCompany(company);
  };

  const closeSidebar = () => {
    setSelectedCompany(null);
  };

  const handleAccept = () => {
    const updatedCompany = { ...selectedCompany, isAccepted: true, hasNotification: true };
    const updatedCompanies = companies.map((company) =>
      company.companyName === selectedCompany.companyName ? updatedCompany : company
    );

    sessionStorage.setItem('companies', JSON.stringify(updatedCompanies));
    setCompanies(updatedCompanies); // Update state to trigger re-render

    alert(`Notification sent to ${selectedCompany.companyName}.`);
    closeSidebar();
  };

  const handleReject = () => {
    const updatedCompanies = companies.filter((company) => company.companyName !== selectedCompany.companyName);
    sessionStorage.setItem('companies', JSON.stringify(updatedCompanies));
    setCompanies(updatedCompanies); // Update state to trigger re-render

    alert(`${selectedCompany.companyName} has been rejected.`);
    closeSidebar();
  };

  const handleDownload = () => {
    const link = document.createElement('a');
    link.href = URL.createObjectURL(selectedCompany.document);
    link.download = selectedCompany.document.name;
    link.click();
  };

  return (
    <div style={{ display: 'flex', justifyContent: 'center', minHeight: '100vh' }}>
      <div style={{ flex: 1 }}>
        <h2>Registered Companies</h2>
        <ul>
          {companies.map((company, index) => (
            <li key={index}>
              {/* Changed <a> to <button> for accessibility */}
              <button onClick={() => openSidebar(company)} style={{ background: 'none', border: 'none', color: 'blue', textDecoration: 'underline' }}>
                {company.companyName}
              </button>
            </li>
          ))}
        </ul>

        {selectedCompany && (
          <div
            style={{
              position: 'fixed',
              top: 0,
              right: 0,
              bottom: 0,
              width: '300px',
              backgroundColor: '#fff',
              borderLeft: '1px solid #ddd',
              padding: '20px',
            }}
          >
            <button onClick={closeSidebar} style={{ marginBottom: '10px' }}>
              Close
            </button>
            <h3>{selectedCompany.companyName}</h3>
            <p><strong>Industry:</strong> {selectedCompany.industry}</p>
            <p><strong>Size:</strong> {selectedCompany.companySize}</p>
            <p><strong>Email:</strong> {selectedCompany.companyEmail}</p>
            <img
              src={selectedCompany.companyLogo}
              alt="Company Logo"
              style={{
                width: 80,
                height: 80,
                borderRadius: '50%',
                objectFit: 'cover',
                marginBottom: '10px',
              }}
            />
            <p><strong>Legal Document:</strong></p>
            {selectedCompany.document && <button onClick={handleDownload}>Download</button>}
            <div style={{ marginTop: '20px' }}>
              <button onClick={handleAccept} style={{ marginRight: '10px' }}>
                Accept
              </button>
              <button onClick={handleReject}>Reject</button>
            </div>
          </div>
        )}
      </div>
    </div>
  );
}

export default CompanyList;
